import styleCss from "./components/style.module.css";
import {BrowserRouter as Router, Route,Routes, Link} from 'react-router-dom'
import Signin from './components/signin';
import { useNavigate } from 'react-router-dom'


function App() {
  const navigate = useNavigate()
  const handleClick = () => {
    navigate("/signin")
  }
  return (
    <Router>

      <div className={styleCss.back}>
            <img src="assets/background.png" className={styleCss.latar} alt="Logo" />

            <img src="assets/icon.png" className={styleCss.icon} alt="Logo" />

            <div className={styleCss.content}>
              <p className={styleCss.text}>
                Sign-up now and subscribe to enjoy all the cool<br />
                and latest books - The best book rental service<br />
                provider in Indonesia
              </p>
              <button className={styleCss.signUp}>Sign Up</button>
              <button onClick={handleClick} className={styleCss.signIn}>Sign In</button >
            </div>
      </div>
        
        
     

      <Routes>
        <Route exact path="/sigin" element={<Signin />} />
      </Routes>
    </Router>
   
  );
}


export default App;
